a.onPostDeserialize:
__ht__function(json, dm, gv, datas) {gv.setMovableFunc(function() { return false });
gv.getSelectWidth = function() {return 0};
const mapInteractor = new ht.graph3d.MapInteractor(gv)
gv.setInteractors([
    mapInteractor
]);
gv.setEye([452, 212, 744]);
gv.setCenter([111, 8, 199]); 
// 点击事件
gv.mi(function (e) {
    if (e.kind === 'click'){
        console.log(e.data.getTag());
    }
	else if (e.kind === 'doubleClickData') {
        if (e.data.getTag() === 'firstProcessRoom') {
            changeScene('scenes/waterSystem/firstRoom.json', [-2044, 1408, 1897], [-579, 54, -66]); 
		}
        else if (e.data.getTag() === 'secondProcessRoom') {
            changeScene('scenes/waterSystem/secondRoom.json', [-2291, 1478, 1892], [-706,8,23]); 
		}
        else if (e.data.getTag() === 'thirdProcessRoom') {
            changeScene('scenes/waterSystem/thirdRoom.json', [-3051, 1595, 2111], [-980, -32, -135]);
		}
        else if (e.data.getTag() === 'waterPumpRoom') {
            changeScene('scenes/waterSystem/pumpRoom.json', [1873, 1167, -913], [570, 136, 341]);
		}
        else if (e.data.getTag() === 'dosingRoom') {
            changeScene('scenes/waterSystem/dosingRoom.json', [-684, 912, -1384], [74, 25, 6]);
		}
        else if (e.data.getTag() === 'recyclingPool') {
            changeScene('scenes/waterSystem/recyclingPool.json', [-145, 77, 274] [-44, 15, 179]);
		} else if (e.data.getTag() === 'recyclingPool') {
            changeScene('scenes/waterSystem/recyclingPool.json');
		}
	}
    else if (e.kind === 'onEnter') {
        if (e.data.getTag() === 'firstProcessRoom') {
            dm.getDataByTag('firstProcessRoomLabel').setStyle('3d.visible', true);
		}
        else if (e.data.getTag() === 'secondProcessRoom') {
            dm.getDataByTag('secondProcessRoomLabel').setStyle('3d.visible', true);
        }
        else if (e.data.getTag() === 'thirdProcessRoom') {
            dm.getDataByTag('thirdProcessRoomLabel').setStyle('3d.visible', true);
		}
        else if (e.data.getTag() === 'waterPumpRoom') {
            dm.getDataByTag('waterPumpRoomLabel').setStyle('3d.visible', true);
		}
        else if (e.data.getTag() === 'dosingRoom') {
            dm.getDataByTag('dosingRoomLabel').setStyle('3d.visible', true);
		}
        else if (e.data.getTag() === 'recyclingPool') {
            dm.getDataByTag('recyclingPoolLabel').setStyle('3d.visible', true);
		} else if (e.data.getTag() === 'recyclingPool') {
            changeScene('scenes/waterSystem/recyclingPool.json');
		}
    }
})

/**
 * 切换至内景
 *
 */
function changeScene(scene,eye,center) {
    dataModel.clear();
    dataModel = new ht.DataModel();
    let g3d = new ht.graph3d.Graph3dView(dataModel);

    g3d.addToDOM();
    g3d.deserialize(scene);
    g3d.setEye(eye);
    g3d.setCenter(center);     
    g3d.setFar(1000000);
}}

